import "./App.css";
import { Routes, Route } from "react-router-dom";

import Header from "./components/Header";
import NotesListPage from "./pages/NotesListPage";

function App() {
  return (
    <div className="App">
      <Header />
      <Routes>
        <Route path="/" exact component={NotesListPage} />
      </Routes>
    </div>
  );
}

export default App;
